import { useEffect, useState } from 'react';
import './App.css';
import axios from 'axios'

function App() {
  const [items, setItems] = useState()
  useEffect(() => {
    const getProducts = () => {
      axios.get('https://fakestoreapi.com/products')
      .then(response => setItems(response.data))
      .catch(error => console.log(error))
    }

    getProducts()
  }, [])

